import React, { useState } from 'react';

export default function MemorizeMajorList() {
    const data = {
        0: "Sea",
        1: "Tea",
        2: "Hen",
        3: "Maa",
        4: "Hero",
        5: "Law",
        6: "Ash",
        7: "Cow",
        8: "Fox",
        9: "Bee",
        10: "Dosa",
        11: "Dadi",
        12: "Don",
        13: "Tom",
        14: "Door",
        15: "Tall",
        16: "Dog",
        17: "Daku",
        18: "TV",
        19: "Tap",
        20: "Nose",
        21: "Net",
        22: "Nani",
        23: "Nami",
        24: "Nari",
        25: "Nail",
        26: "Naag",
        27: "Neck",
        28: "Navy",
        29: "Noob",
        30: "Mouse",
        31: "Meat",
        32: "Money",
        33: "Mommy",
        34: "Merry",
        35: "Meal",
        36: "Magi",
        37: "Mic",
        38: "Movie",
        39: "Map",
        40: "Rose",
        41: "Road",
        42: "Rain",
        43: "Ram",
        44: "Error",
        45: "Rail",
        46: "Rich",
        47: "Rock",
        48: "Roof",
        49: "Rope",
        50: "Lazy",
        51: "Load",
        52: "Loan",
        53: "Lime",
        54: "Healer",
        55: "Lily",
        56: "Leech",
        57: "Lake",
        58: "Luffy",
        59: "Lip",
        60: "Cheese",
        61: "Cheat",
        62: "Chain",
        63: "Jam",
        64: "Chair",
        65: "Jail",
        66: "Gojo",
        67: "Check",
        68: "Chief",
        69: "Shop",
        70: "Kiss",
        71: "Kite",
        72: "Gun",
        73: "Gum",
        74: "Car",
        75: "Kill",
        76: "Cash",
        77: "Cake",
        78: "Coffee",
        79: "Cap",
        80: "Vase",
        81: "Food",
        82: "Van",
        83: "FM",
        84: "Fire",
        85: "Fail",
        86: "Fish",
        87: "Fake",
        88: "FIFA",
        89: "VIP",
        90: "Bus",
        91: "Bat",
        92: "Pen",
        93: "Poem",
        94: "Bar",
        95: "Bell",
        96: "Bag",
        97: "Book",
        98: "Beef",
        99: "Baby",
        100: "Disease"
    };

    const [inputValue, setInputValue] = useState('');
    const [output, setOutput] = useState('');
    const [quizOptions, setQuizOptions] = useState([]);

    const handleInputChange = (e) => {
        const value = e.target.value;
        setInputValue(value);

        if (value in data) {
            setOutput(data[value]);
        } else {
            setOutput("Invalid number");
        }
    };

    const getRandomValue = (min, max) => {
        return Math.floor(Math.random() * (max - min + 1)) + min;
    };

    const generateQuizOptions = () => {
        // Select a random key, ensuring it’s not 11 (Dadi)
        let randomKey = getRandomValue(0, Object.keys(data).length - 1);
        let correctAnswer = randomKey;
        let correctValue = data[correctAnswer];

        // Replace 'Dadi' with the selected random value
        while (correctValue === "Dadi") {
            randomKey = getRandomValue(0, Object.keys(data).length - 1);
            correctAnswer = randomKey;
            correctValue = data[correctAnswer];
        }

        // Generate options, including the correct answer
        const options = new Set();
        options.add(correctAnswer); // Include the correct answer

        // Add random options
        while (options.size < 4) {
            const randomOption = getRandomValue(0, Object.keys(data).length - 1);
            options.add(randomOption);
        }

        setQuizOptions(Array.from(options)); // Convert Set to Array
    };

    return (
        <>
            <div>
                <h1 className='mx-10 my-5 text-3xl font-bold'>Memorize Major List</h1>
                <input
                    className='block w-48 px-3 py-2 bg-white border border-gray-300 rounded-md text-sm shadow-sm focus:outline-none focus:border-sky-500 focus:ring-1 focus:ring-sky-500 [appearance:textfield] [&::-webkit-outer-spin-button]:appearance-none [&::-webkit-inner-spin-button]:appearance-none'
                    type="number"
                    value={inputValue}
                    onChange={handleInputChange}
                    placeholder="Enter a number"
                />
                <p>Result: {output}</p>
            </div>

            {/* Quiz */}
            <div className='w-1/2 m-10'>
                <h2 className='text-2xl font-semibold mx-10'>Quiz to learn Words into Numbers :</h2>
                <div className='w-full h-14 p-1 my-6 border-2 border-gray-500 text-4xl font-semibold justify-center items-center flex'>{output}</div>

                <button
                    onClick={generateQuizOptions}
                    className='mt-4 mb-6 bg-blue-500 text-white p-2 rounded-lg'
                >
                    Generate Quiz Options
                </button>

                {/* Options */}
                <div className='grid grid-cols-2 gap-4'>
                    {quizOptions.map((option) => (
                        <div key={option} className='w-72 h-12 m-4 border-2 border-gray-500 shadow-lg rounded-lg text-3xl font-bold flex justify-center items-center bg-gray-100 hover:bg-gray-300/80 hover:translate-y-1'>
                            {option}
                        </div>
                    ))}
                </div>
            </div>
        </>
    );
}
